import React, { Component } from 'react';
import { Container,Row,Col,Card } from 'react-bootstrap';

class Features extends Component {
  render() {


    return (
      <div id="features">
      <h1> </h1>
      <Row className="ml-3 mr-3">
      <Col lg="4">
      <Card className="center">
        <Card.Img variant="top"  src={'/img11.png'} />
<Card.Footer className="text-muted">Indian State-Wise Data</Card.Footer>

</Card>
      </Col>



      <Col lg="4">
      <Card className="center">
        <Card.Img variant="top" src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Image_created_with_a_mobile_phone.png/1200px-Image_created_with_a_mobile_phone.png" />
<Card.Footer className="text-muted">GoogleMap Data</Card.Footer>

</Card>
      </Col>




      <Col lg="4">
      <Card className="center">
        <Card.Img variant="top" src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Image_created_with_a_mobile_phone.png/1200px-Image_created_with_a_mobile_phone.png" />
      <Card.Footer className="text-muted"> Charts </Card.Footer>

      </Card>
      </Col>








      </Row>

   </div>
    );
  }
}

export default Features;
